import React from 'react'
import { Link } from 'react-router-dom'

const CarCategoryList = () => {
  return (
    <div className='mb-6 border-b border-[#ededed] text-gray-600 text-sm flex'>
        <Link className='pb-2 px-2 border-b-2 border-transparent block'>All Cars</Link>
        <Link className='pb-2 px-2 border-b-2 border-transparent block'></Link>
        <Link className='pb-2 px-2 border-b-2 border-transparent block'></Link>
        <Link className='pb-2 px-2 border-b-2 border-transparent block'></Link>
    </div>
  )
}

export default CarCategoryList
